syntax = "proto3";
option csharp_namespace = "YSFreedom.Common.Protocol";

import "FleurFairPlayerStatInfo.proto";

message FleurFairBossSettleInfo {
	bool is_success = 1;
	uint32 cost_time = 2;
	uint32 energy = 3;
	repeated FleurFairPlayerStatInfo stat_info_list = 4;
	uint32 reward_token_num = 5;
}
